INSERT INTO question_items VALUES (3627, "qi_b23_a", "As you probably know, thousands of adults have difficulties with reading or writing at one time or another.  It would help us if you could answer some questions about your own experience of reading and writing. Since leaving school, have you had any probl", NULL, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",NULL);
INSERT INTO cc_questions VALUES (3627, "qc_b23_a", 3627, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",1,"QuestionItem");
INSERT INTO cc_alls VALUES (425, "CcQuestion", 3627, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000", 424, 1, "f");
INSERT INTO question_items VALUES (3628, "qi_b23_b", "Can you tell me a little more about these problems.  First, are these problems due mainly to you not being able to see properly or do you just have difficulties reading?", NULL, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",NULL);
INSERT INTO cc_questions VALUES (3628, "qc_b23_b", 3628, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",1,"QuestionItem");
INSERT INTO cc_alls VALUES (426, "CcQuestion", 3628, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000", 424, 2, "f");
INSERT INTO question_items VALUES (3629, "qi_b24_a", "Let me ask you first about some of the problems you have with reading.  Can you usually read and understand what is written in a magazine or newspaper?   IF YES: can you usually read this easily, or is it with difficulty?", NULL, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",NULL);
INSERT INTO cc_questions VALUES (3629, "qc_b24_a", 3629, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",1,"QuestionItem");
INSERT INTO cc_alls VALUES (427, "CcQuestion", 3629, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000", 424, 3, "f");
INSERT INTO question_items VALUES (3630, "qi_b24_b", "Can you usually read and understand what is written in a letter sent to you?   IF YES:  Can you usually read this easily or is it with difficulty?", NULL, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",NULL);
INSERT INTO cc_questions VALUES (3630, "qc_b24_b", 3630, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000",1,"QuestionItem");
INSERT INTO cc_alls VALUES (428, "CcQuestion", 3630, "2015-04-13 13:29:15.294000", "2015-04-13 13:29:15.294000", 424, 4, "f");
